#include "system/text.h"

#include "rohan.h"

void mt_render_text_2d(const rohan_shader_spec *spec, void *instance, size_t target_pitch, size_t target_stride,
                       mt_string_view text, int x, int y, int w, int h)
{
    float vertices[] = {x, y, 0.f, 0.f, x + w, y, 1.f, 0.f, x + w, y + h, 1.f, 1.f, x, y + h, 0.f, 1.f};
    uint32_t indices[] = {0, 1, 2, 3};
    rohan_render(spec, instance, target_pitch, target_stride, vertices, indices, 4, ROHAN_QUAD);
}

