typedef struct default_shader_data default_shader_data;
struct default_shader_data
{
    __m256 u, v;
    __m256i color;
    __m256i glyph_offset;
    uint8_t *pixels;
};

static inline void default_shader(void *restrict instance, const rohan_raster_state *restrict state)
{
    default_shader_data *data = instance;

    __m256i tx = _mm256_cvttps_epi32(_mm256_mul_ps(data->u, _mm256_set1_ps(15)));
    __m256i ty = _mm256_cvttps_epi32(_mm256_mul_ps(data->v, _mm256_set1_ps(15)));
    ty = _mm256_slli_epi32(ty, 4);

    __m256i indices = _mm256_add_epi32(_mm256_add_epi32(ty, tx), data->glyph_offset);
    __m256i mask = _mm256_slli_epi32(_mm256_i32gather_epi32(default_font_data, indices, 1), 31);
    _mm256_maskstore_epi32((int *)(data->pixels + state->byte_offset), _mm256_and_si256(mask, state->mask),
                           data->color);
}

void mt_render_text_2d_default(int *pixels, int width, mt_string_view text, int x, int y, int w, int h, int color)
{
    default_shader_data data = {.pixels = (uint8_t *)pixels, .color = _mm256_set1_epi32(color)};

    rohan_shader_spec spec;
    spec.main = default_shader;
    spec.attribute_count = 2;
    spec.attribute_offset = offsetof(default_shader_data, u);

    for (size_t i = 0; i < text.len; ++i)
    {
        data.glyph_offset = _mm256_set1_epi32((text.str[i] - 32) * 16 * 16);
        mt_render_text_2d(&spec, &data, width * sizeof(int), sizeof(int), text, x + i * w, y, w, h);
    }
}
